import styled from 'styled-components'

export const StyledBanner = styled.div`
    height: ${(props) => props.height};
    width: ${(props) => props.width};
    background: #ccc;
    margin-top: 15px;
    border-radius: 7px;
    margin-left: 15px;

    &:first-child {
        margin-top: 0;
    }
`
